const LeagueSection = () => {
    const [leagueState, setLeagueState] = useState("leagues");

    return (
        <div id = "FriendSection">
            <div>
                <h2>Leagues</h2>
                <LeagueBar func = {setLeagueState}></LeagueBar>
            </div>
        </div>
        )
}

export default LeagueSection;
